SELECT MAX("probehnuto_mimo_penezenku"."client_id") as agg_0 FROM "probehnuto_mimo_penezenku"  WHERE ("probehnuto_mimo_penezenku"."Month/Year" LIKE '%2014-01-01%' OR "probehnuto_mimo_penezenku"."Month/Year" LIKE '%2013-02-01%' OR "probehnuto_mimo_penezenku"."Month/Year" NOT LIKE '%2013-%05-01%') AND "probehnuto_mimo_penezenku"."Month/Year" IN ('2013-02-01', '2013-04-01', '2012-11-01', '2013-06-01', '2013-05-01', '2013-01-01', '2012-09-01', '2012-10-01') AND "probehnuto_mimo_penezenku"."probehla_inzerce_mimo_penezenku" LIKE '%ANO%' AND "probehnuto_mimo_penezenku"."probehla_inzerce_mimo_penezenku" != 'ANO' AND "probehnuto_mimo_penezenku"."client_id" BETWEEN 14681 AND 30478